sys_variable_value.value:
(function execute(inputs, outputs) {
    var oktaError = { };
// Will check for error, and also if no error make the object into an array for compatibility with the users pull
// remote table def
    //gs.info(inputs.responseBody);
    try {
        var rb = JSON.parse(inputs.responseBody); //input comes through as a string, need to put it back to an object
    } catch (e){
        // if the JSON parse fails, it's prob a 401 error/token timed out.. no responseBody, throw error to exit
        throw new Error("Invalid response body");
    }
    //gs.info('keys of body: ' + Object.keys(rb));
    if(Object.keys(rb).includes('errorCode')){
        //{"errorCode":"E0000007","errorSummary":"Not found: Resource not found: as (User)","errorLink":"E0000007","errorId":"oaeOKxAGf3ZTFe9qYFUX-ajig","errorCauses":[]}
        oktaError = { "Okta_Error_Code": rb.errorCode, "Error_Message": rb.errorSummary };
        throw new Error(oktaError);
    } else {
        var a = [];
        a.push(rb);
        outputs['new_body'] = JSON.stringify(a);
    }
})(inputs, outputs);

